import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <div className="footer-content">
        <p>&copy; 2024 Youth Coders Collective for HIV/AIDS</p>
        <p>Contact: contact@yourwebsite.com</p>
      </div>
    </footer>
  );
}

export default Footer;
